	private void addQuizzes() {

		quiz_bank[0] = StaticQuizes.quiz0;
		quiz_bank[1] = StaticQuizes.quiz1;
		quiz_bank[2] = StaticQuizes.quiz2;
		quiz_bank[3] = StaticQuizes.quiz3;
		quiz_bank[4] = StaticQuizes.quiz4;

	}

	public void highScoreGUI() {
		if (!score_up) {
			score_up = true;
			gui = new GUIInput(this);
			gui.createAndShowGUI();

		}
	}

	/**
	 * Stefan pauses the game on next update(use this to pause and unpause)
	 */
	public void pause_or_unpause() {
		pause = !pause;
	}

	/**
	 * Stefan pauses the game
	 */
	private void pauseGame() {
		paused = true;
		pause_time = System.nanoTime();
		while (pause) {
			System.gc();
			reDraw();
			try {
				Thread.sleep(1);
			} catch (InterruptedException e) {
				e.printStackTrace();
			}
		}
		pause_time = System.nanoTime() - pause_time;
		paused = false;
	}

	/**
	 * Ben Gotthold re draws the game 30 times a seconds and after the timer
	 * stopped
	 */
	public void reDraw() {
		long now_time = System.currentTimeMillis();

		if (time_gap > 33) { // this is the frequency of refresh
			last_draw = System.currentTimeMillis();
			draw_game.repaint();
			time_gap = 0;

		} else {
			time_gap = now_time - last_draw;

		}
	}

	/**
	 * Stefan Contains the main loop of the game
	 */
	@Override
	public void run() {

		long last_time = System.nanoTime();
		double unprocessed = 0;
		double ns_per_update = 1000000000.0 / 60;
		long last_time1 = System.currentTimeMillis();

		while (game_running) {
			// System.out.println(game_time);
			long now = System.nanoTime();
			unprocessed += (now - last_time) / ns_per_update;
			last_time = now;
			reDraw(); // ben - calls  redraw function
			while (unprocessed >= 1) {
				update();
				unprocessed -= (pause_time / ns_per_update) + 1;
				last_time1 += pause_time / 1000000;
				pause_time = 0;
			}
			//background 
			long now1 = System.currentTimeMillis();
			if (now1 - last_time1 > 500) {
				draw_game.bg_count = (draw_game.bg_count + 1) % 3; 
				game_time -= (now1 - last_time1);

				last_time1 = now1;
			}

			if (game_time < 0) // ben - stop the time from being negative // but keep the game running	
				game_time = 0;
		}
	}

	public void start() {
		time_running = true;
		new Thread(this).start();
		DrawGame.first_fert = false;
		DrawGame.first_oil = false;
		DrawGame.first_erosion_temp = false;
		DrawGame.first_erosion_per = false;
		DrawGame.first_powerup = false;
		DrawGame.first_quiz = false;
	}

	public void stop() {
		time_running = false;
		game_running = false;
		System.gc();
	}

	/**
	 * Stefan updates all elements of the game
	 */
	public void update() {
		update_count++;
		if (pause) {
			pauseGame();
		}
		if (game_time <= 0) {
			highScoreGUI();
			time_running = false;
		} else {
			if (update_count % 300 == 0) {
				map.updateSpeed(game_time);
			}
			map.update();
		}
	}
}

package group2.game;

public class Quiz {
	String question; // The question
	String[] choices = new String[4]; // Choices A,B,C, and D
	int answer; // Index of the correct answer in choices (0 = A, 1 = B, 2 = C,
				// 3 = D)
	public String feedback_string;
	boolean asked;
	Boolean answered_correctly = false;

	Quiz(String question, String[] choices, int answer) {
		this.question = question;
		for (int i = 0; i < 4; i++) {
			this.choices[i] = choices[i];
		}
		this.answer = answer;
		this.asked = false;
	}

	/**
	 * Will check to see whether or not the answer the player choose was correct
	 * or not. I imagine this will probably be called when the powerup is on the
	 * screen and the player picks their choice. This method will then be called
	 * from powerup to check if the player was right or not, and then perform
	 * its actions based on the response.
	 */
	public boolean checkChoice(int choice) {
		if (choice != this.answer){
			feedback_string = "Im sorry! Collect more polutants to try again.";
			return false;
		}
		else{
			feedback_string = "Correct! The city has now passed a new law";
			answered_correctly = true;
			return true;
		}
	}

}

